<p>在温度较低时，振动对于热容的贡献近似可忽略，因此双原子和三原子理想气体的热容相差不大。随着温度升高，振动对于热容的贡献不可忽略，三原子非线性分子由于其更多的振动自由度（有三个，双原子只有一个），导致其热容显著高于双原子分子。</p>
